    margin-left: 50px;
}

section header {
    font-weight: 800;
    font-size: 23px;
    margin-left: -20px;
    margin-bottom: 20px;
}

#main {
    margin: 0 auto;
    
}

main {
    flex-grow: 1;
}

p {
    margin: 10px;
}

ol {
    margin-left: 30px;
}

@media (min-width: 768px) {
    #navbar {
        flex-direction: row;
    }
}

