body {
    font-family: 'Roboto', sans-serif;
    background-color: #f4f4f4;
}

header {
    position: fixed;
    top: 0;
    left: 0;
    right: 0;
    width: 100%;
    display: flex;
    justify-content: space-between; /* Pushes logo to left, nav to right */
    align-items: center; /* Aligns them vertically */
    padding: 10px 20px; /* Adds spacing */
    z-index: 1000; /* Stacks it on top of everything */;
    background-color: #b6b5b5;
}

ul li {
    list-style-type: none;
}
  
#hero {
    margin-top: 80px;
}

#header-img{
    width: 300px;
}

@media only screen and (max-width: 768px) {
    #header-img {
        width: 200px;
    }
    h1, h2, h3, h4 {
        font-size: 1.5rem;
    }
}

* {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

body {
    font-family: 'Roboto', sans-serif;
    background-color: #f5f5f5;
}

#navbar {
    position: fixed;
    width: 100%;
    height: 13vh;
    z-index: 1000;
}

#navbar > ul{
    width: 100%;
    height: 100%;
    background-color: black;
    display: flex;
    justify-content: flex-end;
    gap: 1vw;
    list-style-type: none;
    align-items: center;
}

#navbar > ul > li > a {
    text-decoration: none;
    color: white;
    font-size: 1.2rem;
    padding: 0 20px;
}

#welcome-section {
    width: 100%;
    height: 100vh;
    background: linear-gradient(cornflowerblue, lightblue);
    display: flex;
    justify-content: center;
    align-items: center;
    font-weight: 700;
    font-size: 2rem;
    text-shadow: rgba(44, 44, 44, 0.473) 2px 2px;
}

#projects {
    width: 100%;
    height: 100vh;
    background-color:black;
    display: flex;
    justify-content: center;
    align-items: center;
    font-weight: 700;
    font-size: auto;
    color: white;
    position: relative;
    gap: 20px;
}

#projects a i {
    font-size: 2rem;
}

.project-1, .project-2, .project-3, .project-4 {
    position: absolute;
    width: 250px;
    height: 150px;
    display: flex;
    justify-content: center;
    align-items: center;
    background: linear-gradient(wheat 70%, rgb(7, 188, 243));
    border-radius: 5%;
}

.project-1 {
    top: 10%;
    left: 10%;
}

.project-2 {
    top: 10%;
    right: 10%;
}

.project-3 {
    bottom: 10%;
    left: 10%;
}

.project-4 {
    bottom: 10%;
    right: 10%;
}


footer {
    width: 100%;
    height: 10vh;
    background-color: black;
    color: white;
    display: flex;
    justify-content: space-evenly;
    align-items: center;
    font-size: 1.2rem;
}

footer a {
    text-decoration: none;
    color: white;
    font-size: 1.5rem;
}

.intro {
    animation: intro-animation 1s ease;
}

@keyframes intro-animation {
    0% {
        opacity: 0;
        transform: translateY(-50px);
    }
    100% {
        opacity: 1;
        transform: translateY(0);
    }
}



@media only screen and (max-width: 600px) {
    body {
        font-size: 0.8rem;
    }
    header {
        display: flex;
        justify-content: flex-end;
    }

    #navbar {
        width: 20vw;
        height: 24vh;
    }

    #navbar > ul {
        flex-direction: column;
        gap: 4vh;
        display: flex;
        justify-content: center;
    }

    #navbar > ul > li > a {
        padding: 10px 0;
    }

    footer {
        font-size: 1rem;
    }

    .project-1, .project-2, .project-3, .project-4 {
        width: 150px;
        height: 100px;
    }
}

